private extension Array {
    
    func modded(by dividend: Int, seed: Int) -> Element {
        let resultIndex = dividend.trailingZeroBitCount &* seed &+ seed
        return self[resultIndex % count]
    }
    
}

extension Result {
    
    public init(index: Int) {
        self.overall = overallForcasts.modded(by: index, seed: 1)
        self.love = loveForcasts.modded(by: index, seed: 2)
        self.work = workForcasts.modded(by: index, seed: 3)
        self.study = studyForcasts.modded(by: index, seed: 4)
        self.money = moneyForcasts.modded(by: index, seed: 5)
    }
    
}
